import React from 'react'

class UserSignupPage extends React.Component {

    state = {
        username: null,
        displayName: null,
        password: null,
        passwordRepeat: null
    };

    onChange = event =>{
        const value = event.target.value;
        const field = event.target.name;
        this.setState({
            [field]: value
        })
    }

    // onChangeUsername = event => {
